		final float[] nullBase = null;
		final float[] emptyBase = new float[0];

		// empty arrays
		assertEquals(-1, ArrayUtils.fuzzySearch(nullBase, 5, true));
		assertEquals(-1, ArrayUtils.fuzzySearch(emptyBase, 5, false));

		// value outside the array
